import React from 'react';

const HomePage = () => {
  // Conteúdo mínimo garantido
  return (
    <div style={{
      minHeight: '100vh',
      background: '#121212',
      color: 'white',
      padding: '20px'
    }}>
      <h1>Bem-vindo ao DevPoints</h1>
      <div style={{ marginTop: '20px' }}>
        <a href="/login" style={{ color: '#6c63ff', marginRight: '15px' }}>
          Login
        </a>
        <a href="/register" style={{ color: '#6c63ff' }}>
          Cadastrar
        </a>
      </div>
    </div>
  );
};

export default HomePage;
